var PreProcess=function(){function processClipper(){var $rtClipperSave=$(".rt-clipper-save-hook");if($rtClipperSave.length===0){tools.openMessage("无剪辑内容，无需处理","error");return}$rtClipperSave.each(function(){addClipperShowToBody($(this))})}function addClipperShowToBody($el){if($el[0].tagName==="BODY"){return}$el.addClass("rt-clipper-show-hook");$el.siblings().not(".rt-clipper-border").addClass("rt-clipper-hide-hook");return addClipperShowToBody($el.parent())}this.init=function(){tools.openMessage("begin","error");processClipper()}};